import './App.css';

const App = () => {
  const myName = "Lorem Ipsum My Name xyz";
  const currentDate = new Date().toLocaleDateString();
  const currentTime = new Date().toLocaleTimeString();
  return (
    <div>
      <h1> {myName} </h1>
      <h5>Today Date is: {currentDate} and Time: {currentTime} </h5>      
    </div> 
  )
}
export default App;
